--- Prerequisite Definitions ---
**S_n**: We also denote by $S_n$ the symmetric group on $n$ letters.

---

\label{rem1}
In the setting of Theorem \ref{thm2}, pick $\omega z\in D(\clq_\theta)$ and $\sigma \in S_n$. Clearly
\begin{equation*}
\omega^n=\frac{\overline{\lambda_{\sigma(1)}}}{\overline{\lambda_1}}\cdot \frac{\overline{\lambda_{\sigma(2)}}}{\overline{\lambda_2}}\cdots \frac{\overline{\lambda_{\sigma(n)}}}{\overline{\lambda_n}}=1.
\end{equation*}
Moreover, if $\sigma$ contains a cycle $(i_1 i_2 \dots i_k)$, that is, if $\sigma(i_1)=i_2, \sigma(i_2)=i_3, \ldots, \sigma(i_{k-1})=i_k$, and $\sigma(i_k)=i_1$, then
\begin{equation*}
\omega^k=\frac{\overline{\lambda_{\sigma(i_1)}}}{\overline{\lambda_{i_1}}}\cdot \frac{\overline{\lambda_{\sigma(i_2)}}}{\overline{\lambda_{i_2}}}\cdots \frac{\overline{\lambda_{\sigma(i_k)}}}{\overline{\lambda_{i_k}}}=1.
\end{equation*}

--- Prerequisite Definitions ---
**D**: \def\D{\mathbb{D}}

**\clq_\theta**: The \textit{model space} (or, \textit{finite-dimensional model space} to be more specific) associated with \theta is defined as \[ \clq_{\theta} = H^2 \ominus \theta H^2, \] where $H^2$ denotes the Hardy space on \D. It is known that \[ \text{dim} \clq_\theta = n. \]

**\clz**: \newcommand{\clz}{\mathcal{Z}}

---

Let $n \in \mathbb{N}$, and let $d$ be a divisor of $n$. Then there exists a Blaschke product $\theta$ such that $n := \# \clz(\theta)$ and
\begin{equation*}
D(\clq_\theta)=\langle e^{\frac{2\pi i}{d}}z\rangle.
\end{equation*}

\label{thm - triv L}
Let $\theta$ be a finite Blaschke product. Then $L(Q_\theta)=\{z\}$ if and only if the following conditions hold:
\begin{enumerate}
\item $\theta(0)\neq 0$.
\item $\#\clz(\theta) \geq 2$.
\item For every non-constant affine map $az+b$, other than the identity, there exists $\lambda \in \clz(\theta)$ such that
\[
mult_\theta (\lambda)\neq mult_{\theta}\left(\frac{\bar{a} \lambda}{1-\bar{b} \lambda}\right).
\]
\end{enumerate}

\label{pro1}
Let $\vp$ be a M\"{o}bius transformation, and let $n \in \mathbb{N}$. We have the following:
\begin{itemize}
\item[(i)]  $\varphi \in \cls(\D)$ if and only if $\tilde{\varphi} \in \cls(\D)$.
\item[(ii)] $\varphi^{[n]}=z$ if and only if $\tilde{\varphi}^{[n]}=z$.
\end{itemize}

\label{lary1}
Let $\theta$ be a finite Blaschke product with $\theta(0)=0$ and $\# (\clz(\theta)\setminus \{0\}) \geq 2$, and let $\varphi \in D(Q_\theta)$ be a non-constant function. Then:
\begin{enumerate}
\item $\varphi \in  \mathrm{Aut}(\mathbb{D})$.
\item There exists $m \in \mathbb{N}$ such that  $\varphi^{[m]}=z$.
\end{enumerate}
